NIQE::NIQE(double mean[36], double covar[36][36], int blockSize, double sharpnessThreshold)
{
	this->init(mean, covar, blockSize, sharpnessThreshold);
}

void NIQE::init(double mean[36], double covar[36][36], int blockSize, double sharpnessThreshold)
{
	memcpy(this->mean, mean, sizeof(double) * 36);
	memcpy(this->covar, covar, sizeof(double) * 36 * 36);
	this->blockSize = blockSize;
	this->sharpnessThreshold = sharpnessThreshold;
}
double NIQE::computeQuality(cv::Mat img)
{
	cv::Mat gray;
	cv::cvtColor(img, gray, CV_BGR2GRAY);
	int height = gray.rows;
	int width = gray.cols;

	int block_heightnum = floor(height / this->blockSize);
	int block_widthnum = floor(width / this->blockSize);

	int scalenum = 2;
	cv::Mat kernel = cv::Mat(7, 7, CV_64FC1, &gaussianKernel);
	cv::Mat cM;
	gray.convertTo(cM, CV_64FC1);

	std::vector<std::vector<double>> distparam(block_heightnum*block_widthnum);
	for (int i = 0; i < scalenum; i++)
	{
		cv::Mat mu, sigma, cM_sq, structdis, sigmaP;
		cv::filter2D(cM, mu, -1, kernel, cv::Point(-1, -1), 0, cv::BORDER_REPLICATE);
		cv::Mat mu_sq = mu.mul(mu);
		cM_sq = cM.mul(cM);
		cv::filter2D(cM_sq, sigma, -1, kernel, cv::Point(-1, -1), 0, cv::BORDER_REPLICATE);
		sigma = cv::abs(sigma - mu_sq);
		cv::sqrt(sigma, sigmaP);
		structdis = (cM - mu);
		sigmaP = sigmaP + 1;
		cv::divide(structdis, sigmaP, structdis);
		for (int blockY = 0; blockY < block_heightnum; blockY++)
		{
			int blockSizeY = this->blockSize >> i;
			int blockSizeX = this->blockSize >> i;
			for (int blockX = 0; blockX < block_widthnum; blockX++)
			{
				int blockStartY = blockSizeY * blockY;
				int blockStartX = blockSizeY * blockX;
				cv::Mat block = cv::Mat(structdis, cv::Rect(blockStartX, blockStartY, blockSizeX, blockSizeY));
				std::vector<double> feat = distparam[blockY*block_widthnum + blockX];
				std::vector<double> f = this->computeFeature(block);
				feat.insert(feat.end(), f.begin(), f.end());
				distparam[blockY*block_widthnum + blockX] = feat;
			}
		}
		cv::resize(cM, cM, cv::Size(width >> (i + 1), height >> (i + 1)));
	}
	double mu_distparam[36] = { 0 }, cov_distparam[36][36] = { 0 };
	cv::Mat cov_param = cv::Mat::zeros(36, 36, CV_64FC1);

	for (int i = 0; i < 36; i++)
	{
		for (int d = 0; d < block_heightnum*block_widthnum; d++)
		{
			mu_distparam[i] += distparam[d][i];
		}
		mu_distparam[i] = mu_distparam[i] / (block_heightnum*block_widthnum);
	}
	for (int i = 0; i < 36; i++)
	{
		for (int j = 0; j < 36; j++)
		{
			double sum = 0;
			for (int d = 0; d < block_heightnum*block_widthnum; d++)
			{
				double ss = ((distparam[d][i] - mu_distparam[i])*(distparam[d][j] - mu_distparam[j]));;
				sum += ss;
			}
			cov_distparam[i][j] = sum/(block_heightnum*block_widthnum-1);
		}
	}
	for (int i = 0; i < 36; i++)
	{
		for (int j = 0; j < 36; j++)
		{
			cov_param.at<double>(i,j) = (cov_distparam[i][j] + this->covar[i][j])/2;
		}
	}

	cv::Mat invcov_param;
	cv::invert(cov_param, invcov_param, cv::DECOMP_SVD);

	cv::Mat dd = cv::Mat(1, 36, CV_64FC1);
	for (int i=0;i<36;i++)
	{
		dd.at<double>(0, i) = mu_distparam[i] - this->mean[i];
	}
	cv::Mat dd_trans;
	cv::transpose(dd, dd_trans);
	cv::Mat q = dd*invcov_param*dd_trans;

	return sqrt(q.at<double>(0, 0));
}

std::vector<double> NIQE::computeFeature(cv::Mat img)
{
	std::vector<double> feat;
	double alpha, betal, betar;
	estimateaggdparam(img, alpha, betal, betar);

	feat.push_back(alpha);
	feat.push_back((betal+betar) / 2);
	std::vector<cv::Point> shifts = { cv::Point(1, 0), cv::Point(0, 1), cv::Point(1, 1), cv::Point(-1, 1) };
	for (int i=0;i<shifts.size();i++)
	{
		cv::Mat shifted_img = img.clone();
		circshift(shifted_img, shifts[i]);
		cv::Mat pair = shifted_img.mul(img);
		estimateaggdparam(pair, alpha, betal, betar);
		double meanparam = (betar - betal)*(std::tgamma(2 / alpha) / std::tgamma(1 / alpha));
		feat.push_back(alpha);
		feat.push_back(meanparam);
		feat.push_back(betal);
		feat.push_back(betar);
	}
	return feat;
}

void NIQE::estimateaggdparam(cv::Mat img, double &alpha, double &betal, double &betar)
{
	double leftstd = 0, rightstd = 0;
	int leftcounter = 0, rightcounter = 0;
	double absMean = 0, sqMean = 0;

	int height = img.rows;
	int width = img.cols;

	for (int y=0;y<height;y++)
	{
		for (int x = 0; x < width; x++)
		{
			double v = img.at<double>(y, x);
			if (v < 0)
			{
				leftstd += v * v;
				leftcounter++;
			}
			else if (v > 0)
			{
				rightstd += v * v;
				rightcounter++;
			}
			absMean += abs(v);
			sqMean += v*v;
		}
	}
	leftstd = sqrt(leftstd / leftcounter);
	rightstd = sqrt(rightstd / rightcounter);
	double gammahat = leftstd / rightstd;
	absMean = absMean / (height*width);
	sqMean = sqMean / (height*width);
	double rhat = absMean*absMean / sqMean;
	double rhatnorm = (rhat*(gammahat * gammahat* gammahat + 1)*(gammahat + 1)) / ((gammahat *gammahat + 1)*(gammahat *gammahat + 1));
	double v_min = std::numeric_limits<double>::max();
	int v_pos = -1;
	for (int i=0;i<9801;i++)
	{
		double v = (r_gam[i] - rhatnorm)*(r_gam[i] - rhatnorm);
		if(v<v_min)
		{
			v_min = v;
			v_pos = i;
		}
	}
	alpha = 0.2 + v_pos*0.001;
	double temp = sqrt(std::tgamma(1 / alpha) / std::tgamma(3 / alpha));
	betal = leftstd*temp;
	betar = rightstd*temp;
}